	(30, '2020-10-22 15:09:24', 'tanlk', 'tanlk', '2020-10-22 15:09:54', 'cb0f7930-c005-4b86-83e2-eb5a91463003', NULL, b'0', NULL, NULL, 'a đội bóng có chiến thắng cách biệt lớn nhất là Barcelona, Bayern Munich và Atlanta, trong đó ấn tượng nhất chắc chắn là nhà đương kim vô địch Bayern Munich. Đoàn quân của HLV Hansi Flick phải đối đầu với một đối thủ không hề dễ chịu, Atletico Madrid. Tuy nhiên, đội bóng xứ Bavaria đã giải quyết được tất cả vấn đề.\n\nNeuer chỉ huy hàng phòng thủ tốt khi hóa giải mọi cơ hội của đội khách, trong khi Kingsley Coman tiếp tục cho thấy duyên ghi bàn tại Champions League với một cú đúp và hai kiến tạo. Tiền vệ Corentin Tolliso lập một siêu phẩm trong trận đấu này.\n\nTrận đấu giữa Barcelona và Ferencvaros sở hữu nhiều bàn thắng nhất (6 bàn) trong đó đội chủ nhà đóng góp tới 5 bàn thắng. Messi mở điểm trên chấm phạt đền và Coutinho nâng tỉ số lên thành 3-0, 3 bàn thắng còn lại đều do công của những tài năng trẻ như Ansu Fati, Pedri hay Ousmane Demble. Đây là tín hiệu đáng mừng với các CĐV Barcelona cũng như HLV Ronald Koeman, nhất là khi “Siêu kinh điển” đấu Real Madrid đã cận kề.\n\nTrái ngược với Barcelona, Real Madrid bất ngờ để thua 2-3 trước Shakhtar Donetsk dù được thi đấu trên sân nhà. Thầy trò Zidane thậm chí còn để thua 0-3 ngay trong hiệp một và chỉ vùng lên khi hiệp hai bắt đầu. Ông thầy người Pháp cho nhiều trụ cột nghỉ trong trận đấu này nhưng đây không thể là lý do biện minh cho thất bại.', 0, '2020-10-22 12:00:00', 0, b'0', NULL, 'Lê Kim Tân', NULL, NULL, NULL, 'a đội bóng có chiến thắng cách biệt lớn nhất là Barcelona, Bayern Munich và Atlanta, trong đó ấn tượng nhất chắc chắn là nhà đương kim vô địch Bayern Munich. Đoàn quân của HLV Hansi Flick phải đối đầu với một đối thủ không hề dễ chịu, Atletico Madrid. Tuy nhiên, đội bóng xứ Bavaria đã giải quyết được tất cả vấn đề.\n\nNeuer chỉ huy hàng phòng thủ tốt khi hóa giải mọi cơ hội của đội khách, trong khi Kingsley Coman tiếp tục cho thấy duyên ghi bàn tại Champions League với một cú đúp và hai kiến tạo. Tiền vệ Corentin Tolliso lập một siêu phẩm trong trận đấu này.\n\nTrận đấu giữa Barcelona và Ferencvaros sở hữu nhiều bàn thắng nhất (6 bàn) trong đó đội chủ nhà đóng góp tới 5 bàn thắng. Messi mở điểm trên chấm phạt đền và Coutinho nâng tỉ số lên thành 3-0, 3 bàn thắng còn lại đều do công của những tài năng trẻ như Ansu Fati, Pedri hay Ousmane Demble. Đây là tín hiệu đáng mừng với các CĐV Barcelona cũng như HLV Ronald Koeman, nhất là khi “Siêu kinh điển” đấu Real Madrid đã cận kề.\n\nTrái ngược với Barcelona, Real Madrid bất ngờ để thua 2-3 trước Shakhtar Donetsk dù được thi đấu trên sân nhà. Thầy trò Zidane thậm chí còn để thua 0-3 ngay trong hiệp một và chỉ vùng lên khi hiệp hai bắt đầu. Ông thầy người Pháp cho nhiều trụ cột nghỉ trong trận đấu này nhưng đây không thể là lý do biện minh cho thất bại.', b'0', 0, 0, '2020-10-22 02:02:00', 0, 'asdsadsad', NULL, NULL, NULL, NULL, NULL, 1);
